import{_ as e,c as o,o as t,ag as r}from"./chunks/framework.DXCYPbuZ.js";const d=JSON.parse('{"title":"通用化问题排查步骤","description":"","frontmatter":{},"headers":[],"relativePath":"zh/start/problem_self_check.md","filePath":"zh/start/problem_self_check.md"}'),l={name:"zh/start/problem_self_check.md"};function p(h,a,n,s,i,c){return t(),o("div",null,[...a[0]||(a[0]=[r('<h1 id="通用化问题排查步骤" tabindex="-1">通用化问题排查步骤 <a class="header-anchor" href="#通用化问题排查步骤" aria-label="Permalink to &quot;通用化问题排查步骤&quot;">​</a></h1><blockquote><p><strong>适用于自动化任务执行失败</strong></p></blockquote><p>系统本质是上是模拟人工操作执行自动化任务，所以遵守人工操作的思路，按照如下自助通用化问题排查步骤，能解决大部分的问题，如果无法解决，可提供必要的信息联系客服远程协助</p><h2 id="_1-重启任务-观察自动化操作是否正常" tabindex="-1">1. 重启任务，观察自动化操作是否正常 <a class="header-anchor" href="#_1-重启任务-观察自动化操作是否正常" aria-label="Permalink to &quot;1. 重启任务，观察自动化操作是否正常&quot;">​</a></h2><p>系统是模拟人工操作执行点击等操作的，此时我们打开指纹浏览器，或者手机界面，重启任务，观察一下自动化执行是卡在那里了，一般网络异常，或者账号异常通过此方式直接能发现。</p><h2 id="_2-手机自动化任务失败-请检查app版本" tabindex="-1">2. 手机自动化任务失败，请检查APP版本 <a class="header-anchor" href="#_2-手机自动化任务失败-请检查app版本" aria-label="Permalink to &quot;2. 手机自动化任务失败，请检查APP版本&quot;">​</a></h2><p>如果您运行手机自动化任务失败，请检查一下APP版本是否正确，版本不对，下载安装我们指定的版本，版本参考<a href="./../notice/android_notice.html">手机/模拟器使用注意点</a></p><h2 id="_3-检查设备网络是否正常" tabindex="-1">3. 检查设备网络是否正常 <a class="header-anchor" href="#_3-检查设备网络是否正常" aria-label="Permalink to &quot;3. 检查设备网络是否正常&quot;">​</a></h2><p>代理设置异常，无法访问海外社媒主页，或者是代理网络太慢，导致任务执行失败，所以我们要先检查一下网络是否正常。</p><blockquote><p><strong>当任务在指纹浏览器上执行时</strong></p></blockquote><p>手动启动任务执行失败的指纹浏览器，随便打开Google搜索主页或者Facebook等海外社媒主页，能够正常打开，表示网络正常，反之表示网络异常，自动化任务因为是模拟人工的，网页无法正常打开所以任务不可能执行成功，此时我们按照<a href="./proxy.html">代理设置说明</a>设置代理，再重新启动指纹浏览器，直到更换的代理能正常访问海外社媒主页的时候，再重启之前执行失败的任务。</p><blockquote><p><strong>当任务在手机上执行时</strong></p></blockquote><p>与指纹浏览器类似，手动启动任务执行失败的手机，使用独立窗口模式打开，找到对应的APP，比如执行的是Facebook手机自动发帖，我们打开Facebook APP，下拉刷新主页，能够正常刷新，表示网络正常，反之表示网络异常，此时我们按照<a href="./proxy.html">代理设置说明</a>设置代理，直到更换的代理后能正常刷新App界面后，再重启之前执行失败的任务。</p><h2 id="_4-检查账号是否正常" tabindex="-1">4. 检查账号是否正常 <a class="header-anchor" href="#_4-检查账号是否正常" aria-label="Permalink to &quot;4. 检查账号是否正常&quot;">​</a></h2><blockquote><p><strong>当任务在指纹浏览器上执行时</strong></p></blockquote><p>手动启动任务执行失败的指纹浏览器，打开后显示正常的登录后的主页界面，表示账号正常，反之表示账号异常，如未登录，请登录账号，已登录如果账号被封，请重置指纹环境后绑定新号，重启失败任务。</p><blockquote><p><strong>当任务在手机上执行时</strong></p></blockquote><p>与指纹浏览器类似，手动启动任务执行失败的手机，打开对应APP后显示正常的登录后的主页界面，表示账号正常，反之表示账号异常，如未登录，请登录账号，已登录如果账号被封，请重置设备信息后绑定新号或者新建手机绑定新号[推荐]，重启失败任务或者重新创建任务。</p><h2 id="_5-检查界面语言设置是否正确" tabindex="-1">5. 检查界面语言设置是否正确 <a class="header-anchor" href="#_5-检查界面语言设置是否正确" aria-label="Permalink to &quot;5. 检查界面语言设置是否正确&quot;">​</a></h2><p>指纹浏览器的自动化是基于简体中文/英文两种语言开发的，手机的自动化是基于英文这一种语言开发的，所以您如果发现您自动化任务失败，可以先检查一下网页或者手机app语言设置的是否正确，不正确可以手动调整一下语言后重新执行任务。</p><h2 id="_6-检查自动化任务的设置信息是否正常" tabindex="-1">6. 检查自动化任务的设置信息是否正常 <a class="header-anchor" href="#_6-检查自动化任务的设置信息是否正常" aria-label="Permalink to &quot;6. 检查自动化任务的设置信息是否正常&quot;">​</a></h2><p>我们以TikTok评论用户采集为例，当我们创建此采集任务的时候，配置目标链接需要填写具体视频的分享链接，而不是用户的主页地址，如果填写了用户的主页地址，会导致任务执行失败。</p><p><strong>不同目的的功能，需要设置不同的配置信息，请根据功能目的设置正确的配置信息</strong></p><p>常见的比如粉丝采集，都是输入博主主页地址，评论用户采集，一般书输入帖子的分享链接，点赞用户采集也是输入帖子分享链接，按照功能的目的，我们其实很容易判断需要输入什么。</p><h2 id="_7-关闭电脑的全局代理" tabindex="-1">7. 关闭电脑的全局代理 <a class="header-anchor" href="#_7-关闭电脑的全局代理" aria-label="Permalink to &quot;7. 关闭电脑的全局代理&quot;">​</a></h2><p>系统的服务器位于国内，如果您的电脑开了全局代理，导致将本地网络统一代理绕到海外后，再绕回来访问系统的国内服务器，如果这个代理不是很稳定或者比较慢的话就容易导致自动化任务超时失败，此时可以尝试关闭电脑的全局代理，按照<a href="./proxy.html">代理设置说明</a>设置代理，给指定的设备单独设置代理，然后重启失败的任务。</p><h2 id="_8-卸载杀毒软件-关闭防火墙-浏览器控制-病毒扫描" tabindex="-1">8. 卸载杀毒软件，关闭防火墙，浏览器控制，病毒扫描 <a class="header-anchor" href="#_8-卸载杀毒软件-关闭防火墙-浏览器控制-病毒扫描" aria-label="Permalink to &quot;8. 卸载杀毒软件，关闭防火墙，浏览器控制，病毒扫描&quot;">​</a></h2><p>参考<a href="./install.html">安装说明</a></p><p>很多杀毒软件会默认限制内网的访问，导致AI外贸通无法正常运行，或者是他们自身有一个白名单，非白名单内的软件默认限制，比较简单的方式就是直接卸载杀毒软件，并不代表我们软件对您系统有损害，请放心按照指导步骤操作。</p><h2 id="_9-设置合理的单机最大并行数以及启动间隔" tabindex="-1">9. 设置合理的单机最大并行数以及启动间隔 <a class="header-anchor" href="#_9-设置合理的单机最大并行数以及启动间隔" aria-label="Permalink to &quot;9. 设置合理的单机最大并行数以及启动间隔&quot;">​</a></h2><p><img src="https://spub.xrobot.tech/blog/src/img/fix02.png" alt="设置合理的单机最大并行数以及启动间隔" loading="lazy"></p><p>当您批量执行任务觉得太卡的时候，您可以尝试设置合理的单机最大并行数以及启动间隔，32GB内存的机器，单机最大并行数建议设置为18个以内，启动间隔设置为1到3秒，如使用过程中觉得卡，可以降低并行数。</p>',32)])])}const b=e(l,[["render",p]]);export{d as __pageData,b as default};
